import { VideoInterface } from "../interfaces/video";

const VideoPlayback: React.FC<{ id: number }> = (props: { id: number }) => {
  return (
    <div>
      <h1>{props.name}</h1>
      <video controls style={{ width: '100%' }}>
        <source src={props.url} type="video/mp4" />
      </video>
    </div>
  );
}

export default VideoPlayback;
